import React from 'react';

  // cards attribute data 
  function cData(val){
    return(
    <>
            <div className="col-xl-3 col-lg-3 col-sm-6 col-xs-12">
              <App image={val.image} title={val.title}/>
            </div>
    </>
    );
    }

function card(){    
<div className="container-fluid">
      <div className="row">
        {CardsData.map(cData)}
      </div>
  </div>
}

export default card;
